Hello everyone. I'm trying to create a custom search page. I want it to display 10 results per page and I want to know how to change the text ("Next", "Previous", "No results found", etc) and styling. I have found this on another template:

{% module "search_results"
          path="@HubSpot/search_results",
          title={
            "show_title": "true"
          }
        %}

Can anyone tell me what is the documentation to that module? I found this <https://developers.HubSpot.com/beta-docs/guides/cms/content/content-search> , but I'm not sure if there are more module properties I can set through HubL?
